import React, { Component } from "react";
import Tarjeta from "../../Component/Tarjeta";
import SectionLeft from "./SectionLeft";
import SectionRight from "./SectionRight";
import { Row, Container, ProgressBar } from "react-bootstrap";
import CardFigure from "../../Component/CardFigure";
import Header from "../../Component/Header";
import Menu from "../../Component/Menu";
import Footer from "../../Component/Footer/Footer";
import { Link } from "react-router-dom";
import Map from "./SectionRight/Map";
import Calendar from "./SectionRight/Calendar";
export default class Home extends Component {
  render() {
    return (
      <div className="wrapper">
        <Header />
        <Menu />
        <div>
          {" "}
          {/* Content Wrapper. Contains page content */}
          <div className="content-wrapper">
            {/* Content Header (Page header) */}
            <section className="content-header">
              <div className="container-fluid">
                <div className="row mb-2">
                  <div className="col-sm-6">
                    <h1>404 Error Page</h1>
                  </div>
                  <div className="col-sm-6">
                    <ol className="breadcrumb float-sm-right">
                      <li className="breadcrumb-item">
                        <a href="#">Home</a>
                      </li>
                      <li className="breadcrumb-item active">404 Error Page</li>
                    </ol>
                  </div>
                </div>
              </div>
              {/* /.container-fluid */}
            </section>
            {/* Main content */}
            <section className="content">
              <div className="error-page">
                <h2 className="headline text-warning"> 404</h2>
                <div className="error-content">
                  <h3>
                    <i className="fas fa-exclamation-triangle text-warning" />{" "}
                    Oops! Page not found.
                  </h3>
                  <p>
                    We could not find the page you were looking for. Meanwhile,
                    you may <a href="../../index.html">return to dashboard</a>{" "}
                    or try using the search form.
                  </p>
                  <form className="search-form">
                    <div className="input-group">
                      <input
                        type="text"
                        name="search"
                        className="form-control"
                        placeholder="Search"
                      />
                      <div className="input-group-append">
                        <button
                          type="submit"
                          name="submit"
                          className="btn btn-warning"
                        >
                          <i className="fas fa-search" />
                        </button>
                      </div>
                    </div>
                    {/* /.input-group */}
                  </form>
                </div>
                {/* /.error-content */}
              </div>
              {/* /.error-page */}
            </section>
            {/* /.content */}
          </div>
        </div>
        <Footer />
      </div>
    );
  }
}
